{"title":"average decision time","type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v5.json",
  "usermeta": {
    "name": "PA Decision Duration (Seconds)",
    "description": "Decision duration per PA ID with global time filter and safe average"
  },
  "data": [
    {
      "name": "pa_buckets_raw",
      "url": {
        "index": "prior_auth_v1",
        "%context%": true,
        "%timefield%": "timestamp",
        "body": {
          "size": 0,
          "aggs": {
            "pa_ids": {
              "terms": {
                "field": "pa_id.keyword",
                "size": 10000,
                "order": { "_key": "asc" }
              },
              "aggs": {
                "submitted_time": {
                  "filter": {
                    "term": { "pa_status.keyword": "submitted" }
                  },
                  "aggs": {
                    "min_submitted": {
                      "min": { "field": "timestamp" }
                    }
                  }
                },
                "decision_time": {
                  "filter": {
                    "terms": {
                      "pa_status.keyword": ["approved", "denied"]
                    }
                  },
                  "aggs": {
                    "min_decision": {
                      "min": { "field": "timestamp" }
                    }
                  }
                },
                "decision_duration_ms": {
                  "bucket_script": {
                    "buckets_path": {
                      "decision": "decision_time>min_decision",
                      "submitted": "submitted_time>min_submitted"
                    },
                    "script": "params.decision - params.submitted"
                  }
                }
              }
            },
            "avg_decision_duration_ms": {
              "avg_bucket": {
                "buckets_path": "pa_ids>decision_duration_ms"
              }
            }
          }
        }
      },
      "format": { "property": "aggregations.pa_ids.buckets" }
    },
    {
      "name": "pa_buckets",
      "source": "pa_buckets_raw",
      "transform": [
        {
          "type": "filter",
          "expr": "datum.decision_duration_ms && isValid(datum.decision_duration_ms.value)"
        },
        {
          "type": "formula",
          "as": "duration_seconds",
          "expr": "datum.decision_duration_ms.value / 1000"
        }
      ]
    },
    {
      "name": "overall_avg",
      "url": {
        "index": "prior_auth_v1",
        "%context%": true,
        "%timefield%": "timestamp",
        "body": {
          "size": 0,
          "aggs": {
            "pa_ids": {
              "terms": {
                "field": "pa_id.keyword",
                "size": 10000
              },
              "aggs": {
                "submitted_time": {
                  "filter": { "term": { "pa_status.keyword": "submitted" } },
                  "aggs": {
                    "min_submitted": {
                      "min": { "field": "timestamp" }
                    }
                  }
                },
                "decision_time": {
                  "filter": {
                    "terms": {
                      "pa_status.keyword": ["approved", "denied"]
                    }
                  },
                  "aggs": {
                    "min_decision": {
                      "min": { "field": "timestamp" }
                    }
                  }
                },
                "decision_duration_ms": {
                  "bucket_script": {
                    "buckets_path": {
                      "decision": "decision_time>min_decision",
                      "submitted": "submitted_time>min_submitted"
                    },
                    "script": "params.decision - params.submitted"
                  }
                }
              }
            },
            "avg_decision_duration_ms": {
              "avg_bucket": {
                "buckets_path": "pa_ids>decision_duration_ms"
              }
            }
          }
        }
      },
      "format": { "property": "aggregations.avg_decision_duration_ms.value" },
      "transform": [
        {
          "type": "formula",
          "as": "safe_data",
          "expr": "datum.data != null ? datum.data : 0"
        },
        {
          "type": "formula",
          "as": "avg_seconds",
          "expr": "datum.safe_data / 1000"
        }
      ]
    }
  ],

  "scales": [
    {
      "name": "xscale",
      "type": "band",
      "domain": { "data": "pa_buckets", "field": "key" },
      "range": "width",
      "padding": 0.1
    },
    {
      "name": "yscale",
      "type": "linear",
      "domain": { "data": "pa_buckets", "field": "duration_seconds" },
      "nice": true,
      "range": "height"
    }
  ],

  "axes": [
    {
      "orient": "bottom",
      "scale": "xscale",
      "title": "PA ID",
      "labelAngle": -45
    },
    {
      "orient": "left",
      "scale": "yscale",
      "title": "Decision Duration (seconds)"
    }
  ],

  "marks": [
    {
      "type": "rect",
      "from": { "data": "pa_buckets" },
      "encode": {
        "enter": {
          "x": { "scale": "xscale", "field": "key" },
          "width": { "scale": "xscale", "band": 1 },
          "y": { "scale": "yscale", "field": "duration_seconds" },
          "y2": { "scale": "yscale", "value": 0 },
          "fill": { "value": "#4C78A8" }
        }
      }
    },
    {
      "type": "rule",
      "from": { "data": "overall_avg" },
      "encode": {
        "enter": {
          "y": { "scale": "yscale", "field": "avg_seconds" },
          "x": { "value": 0 },
          "x2": { "signal": "width" },
          "strokeWidth": { "value": 2 },
          "strokeDash": { "value": [4, 4] },
          "stroke": { "value": "#D04437" }
        }
      }
    },
    {
      "type": "text",
      "from": { "data": "overall_avg" },
      "encode": {
        "enter": {
          "x": { "value": 5 },
          "y": { "scale": "yscale", "field": "avg_seconds", "offset": -5 },
          "text": {
            "signal": "'Avg: ' + format(datum.avg_seconds, ',.2f') + ' sec'"
          },
          "fill": { "value": "#D04437" },
          "fontWeight": { "value": "bold" }
        }
      }
    }
  ]
}
"}}
